  diff_date(dt2, dt1) {
    var diff =(dt2.getTime() - dt1.getTime())/(1000 * 3600 * 24);
    var dias = Math.abs(Math.round(diff));
    var horas = Math.round((Math.abs(diff) - dias)*24);
    var minutos = Math.abs(Math.round((((Math.abs(diff) - dias)*24)-horas)*60));
    return {'dias':dias, 'horas':horas,'minutos':minutos};
  }
  
