  addZero(i) {
    if (i < 10) {
      i = "0" + i;
    }
    return i;
  }

  async getTiempo(combates :any){
    var date1, date2, hora1, hora2;
    var date_day_ini, date_month_ini, date_year_ini, date_hour_ini, date_minutes_ini; 
    var date_day_fin, date_month_fin, date_year_fin, date_hour_fin, date_minutes_fin;

    var tam = combates.data.length;
    for(let i=0;i<tam;i++){
      date1 = combates.data[i].ini_combate;
      hora1 = combates.data[i].ini_hora_combate;
      
      date_day_ini = Number(date1.split('-')[0]);
      date_month_ini = Number(date1.split('-')[1]);
      date_year_ini = Number(date1.split('-')[2]);

      date_hour_ini = Number(hora1.split(':')[0]);
      date_minutes_ini = Number(hora1.split(':')[1]);

      if(combates.data[i].estado == 0){
        date2 = combates.data[i].fin_combate;
        hora2 = combates.data[i].fin_hora_combate;
      }else{
        var dateAct = new Date();
        date2 = dateAct.getDate()+"-"+(dateAct.getMonth()+1)+"-"+dateAct.getFullYear();
        hora2 =  dateAct.getHours()+":"+dateAct.getMinutes();
      }

      date_day_fin = this.addZero(Number(date2.split('-')[0]));
      date_month_fin = this.addZero(Number(date2.split('-')[1]));
      date_year_fin = this.addZero(Number(date2.split('-')[2]));

      date_hour_fin = this.addZero(Number(hora2.split(':')[0]));
      date_minutes_fin = this.addZero(Number(hora2.split(':')[1]));
    
      var result = this.diff_date(new Date(date_year_ini, date_month_ini, date_day_ini, date_hour_ini, date_minutes_ini), 
        new Date(date_year_fin, date_month_fin, date_day_fin, date_hour_fin, date_minutes_fin));

      this.tiempo[i] = result.dias;
      this.tiempo2[i] = result.horas;
      this.tiempo3[i] = result.minutos;
    }
  }


