  async calculateTime(date_ini :any, hour_ini :any, date_fin :any, hour_fin :any, estado){

    var date2, hora2;
    var date_day_ini, date_month_ini, date_year_ini, date_hour_ini, date_minutes_ini; 
    var date_day_fin, date_month_fin, date_year_fin, date_hour_fin, date_minutes_fin;
      
      date_day_ini = Number(date_ini.split('-')[0]);
      date_month_ini = Number(date_ini.split('-')[1]);
      date_year_ini = Number(date_ini.split('-')[2]);

      date_hour_ini = Number(hour_ini.split(':')[0]);
      date_minutes_ini = Number(hour_ini.split(':')[1]);

      if(estado == 0){
        date2 = date_fin;
        hora2 = hour_fin;
      }else{
        var dateAct = new Date();
        date2 = dateAct.getDate()+"-"+(dateAct.getMonth()+1)+"-"+dateAct.getFullYear();
        hora2 =  dateAct.getHours()+":"+dateAct.getMinutes();
      }

      date_day_fin = this.addZero(Number(date2.split('-')[0]));
      date_month_fin = this.addZero(Number(date2.split('-')[1]));
      date_year_fin = this.addZero(Number(date2.split('-')[2]));

      date_hour_fin = this.addZero(Number(hora2.split(':')[0]));
      date_minutes_fin = this.addZero(Number(hora2.split(':')[1]));
         
    return this.diff_date(new Date(date_year_ini, date_month_ini, date_day_ini, date_hour_ini, date_minutes_ini), 
        new Date(date_year_fin, date_month_fin, date_day_fin, date_hour_fin, date_minutes_fin));;  
  }

